import{_ as i}from"./plugin-vue_export-helper.21dcd24c.js";import{o as n,c as p,e}from"./app.1e05478d.js";var u="/assets/structure.99fbd5ea.jpg";const a={},r=e('<h1 id="linux-\u548C-unix" tabindex="-1"><a class="header-anchor" href="#linux-\u548C-unix" aria-hidden="true">#</a> Linux \u548C UNIX</h1><p>UNIX \u4E0E Linux \u4E4B\u95F4\u7684\u5173\u7CFB\u662F\u4E00\u4E2A\u5F88\u6709\u610F\u601D\u7684\u8BDD\u9898\u3002\u5728\u76EE\u524D\u4E3B\u6D41\u7684\u670D\u52A1\u5668\u7AEF\u64CD\u4F5C\u7CFB\u7EDF\u4E2D\uFF0CUNIX \u8BDE\u751F\u4E8E 20 \u4E16\u7EAA 60 \u5E74\u4EE3\u672B\uFF0CWindows \u8BDE\u751F\u4E8E 20 \u4E16\u7EAA 80 \u5E74\u4EE3\u4E2D\u671F\uFF0CLinux \u8BDE\u751F\u4E8E 20 \u4E16\u7EAA 90 \u5E74\u4EE3\u521D\uFF0C\u53EF\u4EE5\u8BF4 UNIX \u662F\u64CD\u4F5C\u7CFB\u7EDF\u4E2D\u7684&quot;\u8001\u5927\u54E5&quot;\uFF0C\u540E\u6765\u7684 Windows \u548C Linux \u90FD\u53C2\u8003\u4E86 UNIX\u3002</p><div class="custom-container tip"><p class="custom-container-title">\u63D0\u793A</p><p>\u73B0\u4EE3\u7684 Windows \u7CFB\u7EDF\u5DF2\u7ECF\u671D\u7740\u201C\u56FE\u5F62\u754C\u9762\u201D\u7684\u65B9\u5411\u53D1\u5C55\u4E86\uFF0C\u548C UNIX \u7CFB\u7EDF\u6709\u4E86\u5DE8\u5927\u7684\u5DEE\u5F02\uFF0C\u4ECE\u8868\u9762\u4E0A\u751A\u81F3\u770B\u4E0D\u51FA\u4E24\u8005\u7684\u5173\u8054\u3002</p></div><h2 id="unix-\u7684\u574E\u5777\u5386\u53F2" tabindex="-1"><a class="header-anchor" href="#unix-\u7684\u574E\u5777\u5386\u53F2" aria-hidden="true">#</a> UNIX \u7684\u574E\u5777\u5386\u53F2</h2><p>UNIX \u64CD\u4F5C\u7CFB\u7EDF\u7531\u80AF\xB7\u6C64\u666E\u68EE(Ken Thompson)\u548C\u4E39\u5C3C\u65AF\xB7\u91CC\u5947(Dennis Ritchie)\u53D1\u660E\u3002\u5B83\u7684\u90E8\u5206\u6280\u672F\u6765\u6E90\u53EF\u8FFD\u6EAF\u5230\u4ECE 1965 \u5E74\u5F00\u59CB\u7684 Multics \u5DE5\u7A0B\u8BA1\u5212\uFF0C\u8BE5\u8BA1\u5212\u7531\u8D1D\u5C14\u5B9E\u9A8C\u5BA4\u3001\u7F8E\u56FD\u9EBB\u7701\u7406\u5DE5\u5B66\u9662\u548C\u901A\u7528\u7535\u6C14\u516C\u53F8\u8054\u5408\u53D1\u8D77\uFF0C\u76EE\u6807\u662F\u5F00\u53D1\u4E00\u79CD\u4EA4\u4E92\u5F0F\u7684\u3001\u5177\u6709\u591A\u9053\u7A0B\u5E8F\u5904\u7406\u80FD\u529B\u7684\u5206\u65F6\u64CD\u4F5C\u7CFB\u7EDF\uFF0C\u4EE5\u53D6\u4EE3\u5F53\u65F6\u5E7F\u6CDB\u4F7F\u7528\u7684\u6279\u5904\u7406\u64CD\u4F5C\u7CFB\u7EDF\u3002</p><div class="custom-container tip"><p class="custom-container-title">\u63D0\u793A</p><p>\u5206\u65F6\u64CD\u4F5C\u7CFB\u7EDF\u4F7F\u4E00\u53F0\u8BA1\u7B97\u673A\u53EF\u4EE5\u540C\u65F6\u4E3A\u591A\u4E2A\u7528\u6237\u670D\u52A1\uFF0C\u8FDE\u63A5\u8BA1\u7B97\u673A\u7684\u7EC8\u7AEF\u7528\u6237\u4EA4\u4E92\u5F0F\u53D1\u51FA\u547D\u4EE4\uFF0C\u64CD\u4F5C\u7CFB\u7EDF\u91C7\u7528\u65F6\u95F4\u7247\u8F6E\u8F6C\u7684\u65B9\u5F0F\u5904\u7406\u7528\u6237\u7684\u670D\u52A1\u8BF7\u6C42\u5E76\u5728\u7EC8\u7AEF\u4E0A\u663E\u793A\u7ED3\u679C(\u64CD\u4F5C\u7CFB\u7EDF\u5C06 CPU \u7684\u65F6\u95F4\u5212\u5206\u6210\u82E5\u5E72\u4E2A\u7247\u6BB5\uFF0C\u79F0\u4E3A\u65F6\u95F4\u7247)\u3002\u64CD\u4F5C\u7CFB\u7EDF\u4EE5\u65F6\u95F4\u7247\u4E3A\u5355\u4F4D\uFF0C\u8F6E\u6D41\u4E3A\u6BCF\u4E2A\u7EC8\u7AEF\u7528\u6237\u670D\u52A1\uFF0C\u6BCF\u6B21\u670D\u52A1\u4E00\u4E2A\u65F6\u95F4\u7247\u3002</p></div><p>\u53EF\u60DC\uFF0C\u7531\u4E8E Multics \u5DE5\u7A0B\u8BA1\u5212\u6240\u8FFD\u6C42\u7684\u76EE\u6807\u592A\u5E9E\u5927\u3001\u592A\u590D\u6742\uFF0C\u4EE5\u81F3\u4E8E\u5B83\u7684\u5F00\u53D1\u4EBA\u5458\u90FD\u4E0D\u77E5\u9053\u8981\u505A\u6210\u4EC0\u4E48\u6837\u5B50\uFF0C\u6700\u7EC8\u4EE5\u5931\u8D25\u6536\u573A\u3002</p><p>\u4EE5\u80AF\u2022\u6C64\u666E\u68EE\u4E3A\u9996\u7684\u8D1D\u5C14\u5B9E\u9A8C\u5BA4\u7814\u7A76\u4EBA\u5458\u5438\u53D6\u4E86 Multics \u5DE5\u7A0B\u8BA1\u5212\u5931\u8D25\u7684\u7ECF\u9A8C\u6559\u8BAD\uFF0C\u4E8E 1969 \u5E74\u5B9E\u73B0\u4E86\u4E00\u79CD\u5206\u65F6\u64CD\u4F5C\u7CFB\u7EDF\u7684\u96CF\u5F62\uFF0C1970 \u5E74\u8BE5\u7CFB\u7EDF\u6B63\u5F0F\u53D6\u540D\u4E3A UNIX\u3002</p><p>\u60F3\u4E00\u4E0B\u82F1\u6587\u4E2D\u7684\u524D\u7F00 Multi \u548C Uni\uFF0C\u5C31\u660E\u767D\u4E86 UNIX \u7684\u9690\u610F\u3002Multi \u662F\u5927\u7684\u610F\u601D\uFF0C\u5927\u800C\u4E14\u7E41\uFF1B\u800C Uni \u662F\u5C0F\u7684\u610F\u601D\uFF0C\u5C0F\u800C\u4E14\u5DE7\u3002\u8FD9\u662F UNIX \u5F00\u53D1\u8005\u7684\u8BBE\u8BA1\u521D\u8877\uFF0C\u8FD9\u4E2A\u7406\u5FF5\u4E00\u76F4\u5F71\u54CD\u81F3\u4ECA\u3002</p><p>\u6709\u610F\u601D\u7684\u662F\uFF0C\u80AF\u2022\u6C64\u666E\u68EE\u5F53\u5E74\u5F00\u53D1 UNIX \u7684\u521D\u8877\u662F\u8FD0\u884C\u4ED6\u7F16\u5199\u7684\u4E00\u6B3E\u8BA1\u7B97\u673A\u6E38\u620F Space Travel\uFF0C\u8FD9\u6B3E\u6E38\u620F\u6A21\u62DF\u592A\u9633\u7CFB\u5929\u4F53\u8FD0\u52A8\uFF0C\u7531\u73A9\u5BB6\u9A7E\u9A76\u98DE\u8239\uFF0C\u89C2\u8D4F\u666F\u8272\u5E76\u5C1D\u8BD5\u5728\u5404\u79CD\u884C\u661F\u548C\u6708\u4EAE\u4E0A\u767B\u9646\u3002\u4ED6\u5148\u540E\u5728\u591A\u4E2A\u7CFB\u7EDF\u4E0A\u8BD5\u9A8C\uFF0C\u4F46\u8FD0\u884C\u6548\u679C\u4E0D\u751A\u7406\u60F3\uFF0C\u4E8E\u662F\u51B3\u5B9A\u81EA\u5DF1\u5F00\u53D1\u64CD\u4F5C\u7CFB\u7EDF\uFF0C\u5C31\u8FD9\u6837\uFF0CUNIX \u8BDE\u751F\u4E86\u3002</p><p>\u81EA 1970 \u5E74\u540E\uFF0CUNIX \u7CFB\u7EDF\u5728\u8D1D\u5C14\u5B9E\u9A8C\u5BA4\u5185\u90E8\u7684\u7A0B\u5E8F\u5458\u4E4B\u95F4\u9010\u6E10\u6D41\u884C\u8D77\u6765\u30021971-1972 \u5E74\uFF0C\u80AF\u2022\u6C64\u666E\u68EE\u7684\u540C\u4E8B\u4E39\u5C3C\u65AF\u2022\u91CC\u5947\u53D1\u660E\u4E86\u4F20\u8BF4\u4E2D\u7684 C \u8BED\u8A00\uFF0C\u8FD9\u662F\u4E00\u79CD\u9002\u5408\u7F16\u5199\u7CFB\u7EDF\u8F6F\u4EF6\u7684\u9AD8\u7EA7\u8BED\u8A00\uFF0C\u5B83\u7684\u8BDE\u751F\u662F UNIX \u7CFB\u7EDF\u53D1\u5C55\u8FC7\u7A0B\u4E2D\u7684\u4E00\u4E2A\u91CD\u8981\u91CC\u7A0B\u7891\uFF0C\u5B83\u5BA3\u544A\u4E86\u5728\u64CD\u4F5C\u7CFB\u7EDF\u7684\u5F00\u53D1\u4E2D\uFF0C\u6C47\u7F16\u8BED\u8A00\u4E0D\u518D\u662F\u4E3B\u5BB0\u3002</p><p>\u5230\u4E86 1973 \u5E74\uFF0CUNIX \u7CFB\u7EDF\u7684\u7EDD\u5927\u90E8\u5206\u6E90\u4EE3\u7801\u90FD\u7528 C \u8BED\u8A00\u8FDB\u884C\u4E86\u91CD\u5199\uFF0C\u8FD9\u4E3A\u63D0\u9AD8 UNIX \u7CFB\u7EDF\u7684\u53EF\u79FB\u690D\u6027\u6253\u4E0B\u4E86\u57FA\u7840(\u4E4B\u524D\u64CD\u4F5C\u7CFB\u7EDF\u591A\u91C7\u7528\u6C47\u7F16\u8BED\u8A00\uFF0C\u5BF9\u786C\u4EF6\u4F9D\u8D56\u6027\u5F3A)\uFF0C\u4E5F\u4E3A\u63D0\u9AD8\u7CFB\u7EDF\u8F6F\u4EF6\u7684\u5F00\u53D1\u6548\u7387\u521B\u9020\u4E86\u6761\u4EF6\u3002\u53EF\u4EE5\u8BF4\uFF0CUNIX \u7CFB\u7EDF\u4E0E C \u8BED\u8A00\u662F\u4E00\u5BF9\u5B6A\u751F\u5144\u5F1F\uFF0C\u5177\u6709\u5BC6\u4E0D\u53EF\u5206\u7684\u5173\u7CFB\u3002</p><p>20 \u4E16\u7EAA 70 \u5E74\u4EE3\u521D\uFF0C\u8BA1\u7B97\u673A\u754C\u8FD8\u6709\u4E00\u9879\u4F1F\u5927\u7684\u53D1\u660E\u2014\u2014TCP/IP \u534F\u8BAE\uFF0C\u8FD9\u662F\u5F53\u5E74\u7F8E\u56FD\u56FD\u9632\u90E8\u63A5\u624B ARPAnet \u540E\u6240\u5F00\u53D1\u7684\u7F51\u7EDC\u534F\u8BAE\u3002\u7F8E\u56FD\u56FD\u9632\u90E8\u628A TCP/IP \u534F\u8BAE\u4E0E UNIX \u7CFB\u7EDF\u3001C \u8BED\u8A00\u6346\u7ED1\u5728\u4E00\u8D77\uFF0C\u7531 AT&amp;T \u53D1\u884C\u7ED9\u7F8E\u56FD\u5404\u4E2A\u5927\u5B66\u975E\u5546\u4E1A\u7684\u8BB8\u53EF\u8BC1\uFF0C\u8FD9\u4E3A UNIX \u7CFB\u7EDF\u3001C \u8BED\u8A00\u3001TCP/IP \u534F\u8BAE\u7684\u53D1\u5C55\u62C9\u5F00\u4E86\u5E8F\u5E55\uFF0C\u5B83\u4EEC\u5206\u522B\u5728\u64CD\u4F5C\u7CFB\u7EDF\u3001\u7F16\u7A0B\u8BED\u8A00\u3001\u7F51\u7EDC\u534F\u8BAE\u8FD9\u4E09\u4E2A\u9886\u57DF\u5F71\u54CD\u81F3\u4ECA\u3002\u80AF\u2022\u6C64\u666E\u68EE\u548C\u4E39\u5C3C\u65AF\u2022\u91CC\u5947\u56E0\u5728\u8BA1\u7B97\u673A\u9886\u57DF\u505A\u51FA\u7684\u6770\u51FA\u8D21\u732E\uFF0C\u4E8E 1983 \u5E74\u83B7\u5F97\u4E86\u8BA1\u7B97\u673A\u79D1\u5B66\u7684\u6700\u9AD8\u5956\u2014\u2014\u56FE\u7075\u5956\u3002</p><p>\u968F\u540E\u51FA\u73B0\u4E86\u5404\u79CD\u7248\u672C\u7684 UNIX \u7CFB\u7EDF\uFF0C\u76EE\u524D\u5E38\u89C1\u7684\u6709 Sun Solaris\u3001FreeBSD\u3001IBM AIX\u3001HP-UX \u7B49\u3002</p><h2 id="solaris-\u548C-freebsd" tabindex="-1"><a class="header-anchor" href="#solaris-\u548C-freebsd" aria-hidden="true">#</a> Solaris \u548C FreeBSD</h2><p>\u6211\u4EEC\u91CD\u70B9\u4ECB\u7ECD\u4E00\u4E0B Solaris\uFF0C\u5B83\u662F UNIX \u7CFB\u7EDF\u7684\u4E00\u4E2A\u91CD\u8981\u5206\u652F\u3002Solaris \u9664\u53EF\u4EE5\u8FD0\u884C\u5728 SPARC CPU \u5E73\u53F0\u4E0A\u5916\uFF0C\u8FD8\u53EF\u4EE5\u8FD0\u884C\u5728 x86 CPU \u5E73\u53F0\u4E0A\u3002\u5728\u670D\u52A1\u5668\u5E02\u573A\u4E0A\uFF0CSun \u7684\u786C\u4EF6\u5E73\u53F0\u5177\u6709\u9AD8\u53EF\u7528\u6027\u548C\u9AD8\u53EF\u9760\u6027\uFF0C\u662F\u5E02\u573A\u4E0A\u5904\u4E8E\u652F\u914D\u5730\u4F4D\u7684 UNIX \u7CFB\u7EDF\u3002</p><p>\u5BF9\u4E8E\u96BE\u4EE5\u63A5\u89E6\u5230 Sun SPARC \u67B6\u6784\u8BA1\u7B97\u673A\u7684\u7528\u6237\u6765\u8BF4\uFF0C\u53EF\u4EE5\u901A\u8FC7\u4F7F\u7528 Solaris x86 \u6765\u4F53\u9A8C\u4E16\u754C\u77E5\u540D\u5927\u5382\u7684\u5546\u4E1A UNIX \u98CE\u91C7\u3002\u5F53\u7136\uFF0CSolaris x86 \u4E5F\u53EF\u4EE5\u7528\u4E8E\u5B9E\u9645\u751F\u4EA7\u5E94\u7528\u7684\u670D\u52A1\u5668\uFF0C\u5728\u9075\u5B88 Sun \u7684\u6709\u5173\u8BB8\u53EF\u6761\u6B3E\u7684\u60C5\u51B5\u4E0B\uFF0CSolaris x86 \u53EF\u4EE5\u514D\u8D39\u7528\u4E8E\u5B66\u4E60\u7814\u7A76\u6216\u5546\u4E1A\u5E94\u7528\u3002</p><p>FreeBSD \u6E90\u4E8E\u7F8E\u56FD\u52A0\u5229\u798F\u5C3C\u4E9A\u5927\u5B66\u4F2F\u514B\u5229\u5206\u6821\u5F00\u53D1\u7684 UNIX \u7248\u672C\uFF0C\u5B83\u7531\u6765\u81EA\u4E16\u754C\u5404\u5730\u7684\u5FD7\u613F\u8005\u5F00\u53D1\u548C\u7EF4\u62A4\uFF0C\u4E3A\u4E0D\u540C\u67B6\u6784\u7684\u8BA1\u7B97\u673A\u7CFB\u7EDF\u63D0\u4F9B\u4E86\u4E0D\u540C\u7A0B\u5EA6\u7684\u652F\u6301\u3002FreeBSD \u5728 BSD \u8BB8\u53EF\u534F\u8BAE\u4E0B\u53D1\u5E03\uFF0C\u5141\u8BB8\u4EFB\u4F55\u4EBA\u5728\u4FDD\u7559\u7248\u6743\u548C\u8BB8\u53EF\u534F\u8BAE\u4FE1\u606F\u7684\u524D\u63D0\u4E0B\u968F\u610F\u4F7F\u7528\u548C\u53D1\u884C\uFF0C\u5E76\u4E0D\u9650\u5236\u5C06 FreeBSD \u7684\u4EE3\u7801\u5728\u53E6\u4E00\u534F\u8BAE\u4E0B\u53D1\u884C\uFF0C\u56E0\u6B64\u5546\u4E1A\u516C\u53F8\u53EF\u4EE5\u81EA\u7531\u5730\u5C06 FreeBSD \u4EE3\u7801\u878D\u5165\u5B83\u4EEC\u7684\u4EA7\u54C1\u4E2D\u3002\u82F9\u679C\u516C\u53F8\u7684 macOS \u5C31\u662F\u57FA\u4E8E FreeBSD \u7684\u64CD\u4F5C\u7CFB\u7EDF\u3002</p><p>FreeBSD \u4E0E Linux \u7684\u7528\u6237\u7FA4\u6709\u76F8\u5F53\u4E00\u90E8\u5206\u662F\u91CD\u5408\u7684\uFF0C\u4E8C\u8005\u652F\u6301\u7684\u786C\u4EF6\u73AF\u5883\u4E5F\u6BD4\u8F83\u4E00\u81F4\uFF0C\u6240\u91C7\u7528\u7684\u8F6F\u4EF6\u4E5F\u6BD4\u8F83\u7C7B\u4F3C\u3002FreeBSD \u7684\u6700\u5927\u7279\u70B9\u5C31\u662F\u7A33\u5B9A\u548C\u9AD8\u6548\uFF0C\u662F\u4F5C\u4E3A\u670D\u52A1\u5668\u64CD\u4F5C\u7CFB\u7EDF\u7684\u4E0D\u9519\u9009\u62E9\uFF1B\u4F46\u5176\u5BF9\u786C\u4EF6\u7684\u652F\u6301\u6CA1\u6709 Linux \u5B8C\u5907\uFF0C\u6240\u4EE5\u5E76\u4E0D\u9002\u5408\u4F5C\u4E3A\u684C\u9762\u7CFB\u7EDF\u3002</p><p>\u5176\u4ED6 UNIX \u7248\u672C\u56E0\u5E94\u7528\u8303\u56F4\u76F8\u5BF9\u6709\u9650\uFF0C\u5728\u6B64\u4E0D\u505A\u8FC7\u591A\u4ECB\u7ECD\u3002</p><h2 id="linux-\u7684\u90A3\u4E9B\u5F80\u4E8B" tabindex="-1"><a class="header-anchor" href="#linux-\u7684\u90A3\u4E9B\u5F80\u4E8B" aria-hidden="true">#</a> Linux \u7684\u90A3\u4E9B\u5F80\u4E8B</h2><p>Linux \u5185\u6838\u6700\u521D\u662F\u7531\u674E\u7EB3\u65AF\u2022\u6258\u74E6\u5179(Linus Torvalds)\u5728\u8D6B\u5C14\u8F9B\u57FA\u5927\u5B66\u8BFB\u4E66\u65F6\u51FA\u4E8E\u4E2A\u4EBA\u7231\u597D\u800C\u7F16\u5199\u7684\uFF0C\u5F53\u65F6\u4ED6\u89C9\u5F97\u6559\u5B66\u7528\u7684\u8FF7\u60A8\u7248 UNIX \u64CD\u4F5C\u7CFB\u7EDF Minix \u592A\u96BE\u7528\u4E86\uFF0C\u4E8E\u662F\u51B3\u5B9A\u81EA\u5DF1\u5F00\u53D1\u4E00\u4E2A\u64CD\u4F5C\u7CFB\u7EDF\u3002\u7B2C 1 \u7248\u672C\u4E8E 1991 \u5E74 9 \u6708\u53D1\u5E03\uFF0C\u5F53\u65F6\u4EC5\u6709 10 000 \u884C\u4EE3\u7801\u3002</p><p>\u674E\u7EB3\u65AF\u2022\u6258\u74E6\u5179\u6CA1\u6709\u4FDD\u7559 Linux \u6E90\u4EE3\u7801\u7684\u7248\u6743\uFF0C\u516C\u5F00\u4E86\u4EE3\u7801\uFF0C\u5E76\u9080\u8BF7\u4ED6\u4EBA\u4E00\u8D77\u5B8C\u5584 Linux\u3002\u4E0E Windows \u53CA\u5176\u4ED6\u6709\u4E13\u5229\u6743\u7684\u64CD\u4F5C\u7CFB\u7EDF\u4E0D\u540C\uFF0CLinux \u5F00\u653E\u6E90\u4EE3\u7801\uFF0C\u4EFB\u4F55\u4EBA\u90FD\u53EF\u4EE5\u514D\u8D39\u4F7F\u7528\u5B83\u3002</p><p>\u636E\u4F30\u8BA1\uFF0C\u73B0\u5728\u53EA\u6709 2% \u7684 Linux \u6838\u5FC3\u4EE3\u7801\u662F\u7531\u674E\u7EB3\u65AF\u2022\u6258\u74E6\u5179\u81EA\u5DF1\u7F16\u5199\u7684\uFF0C\u867D\u7136\u4ED6\u4ECD\u7136\u62E5\u6709 Linux \u5185\u6838(\u64CD\u4F5C\u7CFB\u7EDF\u7684\u6838\u5FC3\u90E8\u5206)\uFF0C\u5E76\u4E14\u4FDD\u7559\u4E86\u9009\u62E9\u65B0\u4EE3\u7801\u548C\u9700\u8981\u5408\u5E76\u7684\u65B0\u65B9\u6CD5\u7684\u6700\u7EC8\u88C1\u5B9A\u6743\u3002\u73B0\u5728\u5927\u5BB6\u6240\u4F7F\u7528\u7684 Linux\uFF0C\u6211\u66F4\u503E\u5411\u4E8E\u8BF4\u662F\u7531\u674E\u7EB3\u65AF\u2022\u6258\u74E6\u5179\u548C\u540E\u6765\u9646\u7EED\u52A0\u5165\u7684\u4F17\u591A Linux \u597D\u8005\u5171\u540C\u5F00\u53D1\u5B8C\u6210\u7684\u3002</p><p>\u674E\u7EB3\u65AF\u2022\u6258\u74E6\u5179\u65E0\u7591\u662F\u8FD9\u4E2A\u4E16\u754C\u4E0A\u6700\u4F1F\u5927\u7684\u7A0B\u5E8F\u5458\u4E4B\u4E00\uFF0C\u4F55\u51B5\uFF0C\u4ED6\u8FD8\u641E\u51FA\u4E86\u5168\u4E16\u754C\u6700\u5927\u7684\u7A0B\u5E8F\u5458\u4EA4\u53CB\u793E\u533A GitHub (\u5F00\u6E90\u4EE3\u7801\u5E93\u53CA\u7248\u672C\u63A7\u5236\u7CFB\u7EDF)\u3002</p><p>\u5173\u4E8E Linux Logo \u7684\u7531\u6765\u662F\u4E00\u4E2A\u5F88\u6709\u610F\u601D\u7684\u8BDD\u9898\uFF0C\u5B83\u662F\u4E00\u53EA\u4F01\u9E45\u3002\u4F01\u9E45\u662F\u5357\u6781\u6D32\u7684\u6807\u5FD7\u6027\u52A8\u7269\uFF0C\u6839\u636E\u56FD\u9645\u516C\u7EA6\uFF0C\u5357\u6781\u6D32\u4E3A\u5168\u4EBA\u7C7B\u5171\u540C\u6240\u6709\uFF0C\u4E0D\u5C5E\u4E8E\u4E16\u754C\u4E0A\u7684\u4EFB\u4F55\u56FD\u5BB6\uFF0C\u4EFB\u4F55\u56FD\u5BB6\u90FD\u65E0\u6743\u5C06\u5357\u6781\u6D32\u7EB3\u5165\u5176\u7248\u56FE\u3002Linux \u9009\u62E9\u4F01\u9E45\u56FE\u6848\u4F5C\u4E3A Logo\uFF0C\u5176\u542B\u4E49\u662F: \u5F00\u653E\u6E90\u4EE3\u7801\u7684 Linux \u4E3A\u5168\u4EBA\u7C7B\u5171\u540C\u6240\u6709\uFF0C\u4EFB\u4F55\u516C\u53F8\u65E0\u6743\u5C06\u5176\u79C1\u6709\u3002</p><h2 id="unix-\u4E0E-linux-\u7684\u5173\u7CFB" tabindex="-1"><a class="header-anchor" href="#unix-\u4E0E-linux-\u7684\u5173\u7CFB" aria-hidden="true">#</a> UNIX \u4E0E Linux \u7684\u5173\u7CFB</h2><p>\u4E8C\u8005\u7684\u5173\u7CFB\uFF0C\u4E0D\u662F\u5927\u54E5\u548C\u5C0F\u5F1F\uFF0C&quot;UNIX \u662F Linux \u7684\u7236\u4EB2&quot;\u8FD9\u4E2A\u8BF4\u6CD5\u66F4\u6021\u5F53\u3002\u4E4B\u6240\u4EE5\u8981\u4ECB\u7ECD\u5B83\u4EEC\u7684\u5173\u7CFB\uFF0C\u662F\u56E0\u4E3A\u8981\u544A\u8BC9\u8BFB\u8005\uFF0C\u5728\u5B66\u4E60\u7684\u65F6\u5019\uFF0C\u5176\u5B9E Linux \u4E0E UNIX \u6709\u5F88\u591A\u7684\u5171\u901A\u4E4B\u5904\uFF0C\u7B80\u5355\u5730\u8BF4\uFF0C\u5982\u679C\u60A8\u5DF2\u7ECF\u719F\u7EC3\u638C\u63E1\u4E86 Linux\uFF0C\u90A3\u4E48\u518D\u4E0A\u624B\u4F7F\u7528 UNIX \u4F1A\u975E\u5E38\u5BB9\u6613\u3002</p><p>\u4E8C\u8005\u4E5F\u6709\u4E24\u4E2A\u5927\u7684\u533A\u522B:</p><ul><li><p>UNIX \u7CFB\u7EDF\u5927\u591A\u662F\u4E0E\u786C\u4EF6\u914D\u5957\u7684\uFF0C\u4E5F\u5C31\u662F\u8BF4\uFF0C\u5927\u591A\u6570 UNIX \u7CFB\u7EDF\u5982 AIX\u3001HP-UX \u7B49\u662F\u65E0\u6CD5\u5B89\u88C5\u5728 x86 \u670D\u52A1\u5668\u548C\u4E2A\u4EBA\u8BA1\u7B97\u673A\u4E0A\u7684\uFF0C\u800C Linux \u5219\u53EF\u4EE5\u8FD0\u884C\u5728\u591A\u79CD\u786C\u4EF6\u5E73\u53F0\u4E0A\uFF1B</p></li><li><p>UNIX \u662F\u5546\u4E1A\u8F6F\u4EF6\uFF0C\u800C Linux \u662F\u5F00\u6E90\u8F6F\u4EF6\uFF0C\u662F\u514D\u8D39\u3001\u516C\u5F00\u6E90\u4EE3\u7801\u7684\u3002</p></li></ul><p>Linux \u53D7\u81F3\u65F7\u5927\u8BA1\u7B97\u673A\u7231\u597D\u8005\u7684\u559C\u7231\uFF0C\u4E3B\u8981\u539F\u56E0\u4E5F\u6709\u4E24\u4E2A:</p><ul><li><p>\u5B83\u5C5E\u4E8E\u5F00\u6E90\u8F6F\u4EF6\uFF0C\u7528\u6237\u4E0D\u7528\u652F\u4ED8\u53EF\u8D39\u7528\u5C31\u53EF\u4EE5\u83B7\u5F97\u5B83\u548C\u5B83\u7684\u6E90\u4EE3\u7801\uFF0C\u5E76\u4E14\u53EF\u4EE5\u6839\u636E\u81EA\u5DF1\u7684\u9700\u8981\u5BF9\u5B83\u8FDB\u884C\u5FC5\u8981\u7684\u4FEE\u6539\uFF0C\u65E0\u507F\u4F7F\u7528\uFF0C\u65E0\u7EA6\u675F\u5730\u7EE7\u7EED\u4F20\u64AD\uFF1B</p></li><li><p>\u5B83\u5177\u6709 UNIX \u7684\u5168\u90E8\u529F\u80FD\uFF0C\u4EFB\u4F55\u4F7F\u7528 UNIX \u64CD\u4F5C\u7CFB\u7EDF\u6216\u60F3\u8981\u5B66\u4E60 UNIX \u64CD\u4F5C\u7CFB\u7EDF\u7684\u4EBA\u90FD\u53EF\u4EE5\u4ECE Linux \u4E2D\u83B7\u76CA\u3002</p></li></ul><p>\u5F00\u6E90\u8F6F\u4EF6\u662F\u4E0D\u540C\u4E8E\u5546\u4E1A\u8F6F\u4EF6\u7684\u4E00\u79CD\u6A21\u5F0F\uFF0C\u4ECE\u5B57\u9762\u4E0A\u7406\u89E3\uFF0C\u5C31\u662F\u5F00\u653E\u6E90\u4EE3\u7801\uFF0C\u5927\u5BB6\u4E0D\u7528\u62C5\u5FC3\u91CC\u9762\u4F1A\u641E\u4EC0\u4E48\u732B\u817B\uFF0C\u8FD9\u4F1A\u5E26\u6765\u8F6F\u4EF6\u7684\u9769\u65B0\u548C\u5B89\u5168\u3002</p><p>\u53E6\u5916\uFF0C\u5F00\u6E90\u5176\u5B9E\u5E76\u4E0D\u7B49\u540C\u4E8E\u514D\u8D39\uFF0C\u800C\u662F\u4E00\u79CD\u65B0\u7684\u8F6F\u4EF6\u76C8\u5229\u6A21\u5F0F\u3002\u76EE\u524D\u5F88\u591A\u8F6F\u4EF6\u90FD\u662F\u5F00\u6E90\u8F6F\u4EF6\uFF0C\u5BF9\u8BA1\u7B97\u673A\u884C\u4E1A\u4E0E\u4E92\u8054\u7F51\u5F71\u54CD\u6DF1\u8FDC\u3002</p><p>\u8FD1\u5E74\u6765\uFF0CLinux \u5DF2\u7ECF\u9752\u51FA\u4E8E\u84DD\u800C\u80DC\u4E8E\u84DD\uFF0C\u4EE5\u8D85\u5E38\u7684\u901F\u5EA6\u53D1\u5C55\uFF0C\u4ECE\u4E00\u4E2A\u4E11\u5C0F\u9E2D\u53D8\u6210\u4E86\u4E00\u4E2A\u62E5\u6709\u5E9E\u5927\u7528\u6237\u7FA4\u7684\u771F\u6B63\u4F18\u79C0\u7684\u3001\u503C\u5F97\u4FE1\u8D56\u7684\u64CD\u4F5C\u7CFB\u7EDF\u3002\u5386\u53F2\u7684\u8F66\u8F6E\u8BA9 Linux \u6210\u4E3A UNIX \u6700\u4F18\u79C0\u7684\u4F20\u627F\u8005\u3002</p><div class="custom-container tip"><p class="custom-container-title">\u603B\u7ED3</p><p>Linux \u662F\u4E00\u4E2A\u7C7B\u4F3C Unix \u7684\u64CD\u4F5C\u7CFB\u7EDF\uFF0CUnix \u8981\u65E9\u4E8E Linux\uFF0CLinux \u7684\u521D\u8877\u5C31\u662F\u8981\u66FF\u4EE3 UNIX\uFF0C\u5E76\u5728\u529F\u80FD\u548C\u7528\u6237\u4F53\u9A8C\u4E0A\u8FDB\u884C\u4F18\u5316\uFF0C\u6240\u4EE5 Linux \u6A21\u4EFF\u4E86 UNIX(\u4F46\u5E76\u6CA1\u6709\u6284\u88AD UNIX \u7684\u6E90\u7801)\uFF0C\u4F7F\u5F97 Linux \u5728\u5916\u89C2\u548C\u4EA4\u4E92\u4E0A\u4E0E UNIX \u975E\u5E38\u7C7B\u4F3C\u3002</p></div><p>\u76F8\u6BD4\u4E8E UNIX\uFF0CLinux \u6700\u5927\u7684\u521B\u65B0\u662F\u5F00\u6E90\u514D\u8D39\uFF0C\u8FD9\u662F\u5B83\u80FD\u591F\u84EC\u52C3\u53D1\u5C55\u7684\u6700\u91CD\u8981\u539F\u56E0\uFF1B\u800C\u76EE\u524D\u7684 UNIX \u5927\u90E8\u5206\u90FD\u662F\u6536\u8D39\u7684\uFF0C\u5C0F\u516C\u53F8\u548C\u4E2A\u4EBA\u90FD\u96BE\u4EE5\u627F\u53D7\u3002</p><p>\u6B63\u662F\u7531\u4E8E Linux \u548C UNIX \u6709\u7740\u5343\u4E1D\u4E07\u7F15\u7684\u8054\u7CFB\uFF0C\u6240\u4EE5\u4EBA\u4EEC\u628A Linux \u53EB\u505A\u201C\u7C7B UNIX \u7CFB\u7EDF\u201D\u3002</p><h2 id="unix-linux-\u7CFB\u7EDF\u7ED3\u6784" tabindex="-1"><a class="header-anchor" href="#unix-linux-\u7CFB\u7EDF\u7ED3\u6784" aria-hidden="true">#</a> UNIX/Linux \u7CFB\u7EDF\u7ED3\u6784</h2><p>UNIX/Linux \u7CFB\u7EDF\u53EF\u4EE5\u7C97\u7CD9\u5730\u62BD\u8C61\u4E3A 3 \u4E2A\u5C42\u6B21(\u6240\u8C13\u7C97\u7CD9\uFF0C\u5C31\u662F\u4E0D\u591F\u7EC6\u81F4\u3001\u7CBE\u51C6\uFF0C\u4F46\u662F\u4FBF\u4E8E\u521D\u5B66\u8005\u6293\u4F4F\u91CD\u70B9\u7406\u89E3)\uFF0C\u5982\u56FE 3 \u6240\u793A\u3002\u5E95\u5C42\u662F UNIX/Linux \u64CD\u4F5C\u7CFB\u7EDF\uFF0C\u5373\u7CFB\u7EDF\u5185\u6838(Kernel)\uFF1B\u4E2D\u95F4\u5C42\u662F Shell \u5C42\uFF0C\u5373\u547D\u4EE4\u89E3\u91CA\u5C42\uFF1B\u9AD8\u5C42\u5219\u662F\u5E94\u7528\u5C42\u3002</p><p><img src="'+u+'" alt="Structrure" loading="lazy"></p><ol><li><p>\u5185\u6838\u5C42</p><p>\u5185\u6838\u5C42\u662F UNIX/Linux \u7CFB\u7EDF\u7684\u6838\u5FC3\u548C\u57FA\u7840\uFF0C\u5B83\u76F4\u63A5\u9644\u7740\u5728\u786C\u4EF6\u5E73\u53F0\u4E4B\u4E0A\uFF0C\u63A7\u5236\u548C\u7BA1\u7406\u7CFB\u7EDF\u5185\u5404\u79CD\u8D44\u6E90(\u786C\u4EF6\u8D44\u6E90\u548C\u8F6F\u4EF6\u8D44\u6E90)\uFF0C\u6709\u6548\u5730\u7EC4\u7EC7\u8FDB\u7A0B\u7684\u8FD0\u884C\uFF0C\u4ECE\u800C\u6269\u5C55\u786C\u4EF6\u7684\u529F\u80FD\uFF0C\u63D0\u9AD8\u8D44\u6E90\u7684\u5229\u7528\u6548\u7387\uFF0C\u4E3A\u7528\u6237\u63D0\u4F9B\u65B9\u4FBF\u3001\u9AD8\u6548\u3001\u5B89\u5168\u3001\u53EF\u9760\u7684\u5E94\u7528\u73AF\u5883\u3002</p></li><li><p>Shell \u5C42</p><p>Shell \u5C42\u662F\u4E0E\u7528\u6237\u76F4\u63A5\u4EA4\u4E92\u7684\u754C\u9762\u3002\u7528\u6237\u53EF\u4EE5\u5728\u63D0\u793A\u7B26\u4E0B\u8F93\u5165\u547D\u4EE4\u884C\uFF0C\u7531 Shell \u89E3\u91CA\u6267\u884C\u5E76\u8F93\u51FA\u76F8\u5E94\u7ED3\u679C\u6216\u8005\u6709\u5173\u4FE1\u606F\uFF0C\u6240\u4EE5\u6211\u4EEC\u4E5F\u628A Shell \u79F0\u4F5C\u547D\u4EE4\u89E3\u91CA\u5668\uFF0C\u5229\u7528\u7CFB\u7EDF\u63D0\u4F9B\u7684\u4E30\u5BCC\u547D\u4EE4\u53EF\u4EE5\u5FEB\u6377\u800C\u7B80\u4FBF\u5730\u5B8C\u6210\u8BB8\u591A\u5DE5\u4F5C\u3002</p></li><li><p>\u5E94\u7528\u5C42</p><p>\u5E94\u7528\u5C42\u63D0\u4F9B\u57FA\u4E8E X Window \u534F\u8BAE\u7684\u56FE\u5F62\u73AF\u5883\u3002X Window \u534F\u8BAE\u5B9A\u4E49\u4E86\u4E00\u4E2A\u7CFB\u7EDF\u6240\u5FC5\u987B\u5177\u5907\u7684\u529F\u80FD(\u5C31\u5982\u540C TCP/IP \u662F\u4E00\u4E2A\u534F\u8BAE\uFF0C\u5B9A\u4E49\u8F6F\u4EF6\u6240\u5E94\u5177\u5907\u7684\u529F\u80FD)\uFF0C\u53EF\u7CFB\u7EDF\u80FD\u6EE1\u8DB3\u6B64\u534F\u8BAE\u53CA\u7B26\u5408 X \u534F\u4F1A\u5176\u4ED6\u7684\u89C4\u8303\uFF0C\u4FBF\u53EF\u79F0\u4E3A X Window\u3002</p></li></ol><p>\u73B0\u5728\u5927\u591A\u6570\u7684 UNIX \u7CFB\u7EDF\u4E0A(\u5305\u62EC Solaris\u3001HP-UX\u3001AIX \u7B49)\u90FD\u53EF\u4EE5\u8FD0\u884C CDE (Common Desktop Environment\uFF0C\u901A\u7528\u684C\u9762\u73AF\u5883\uFF0C\u662F\u8FD0\u884C\u4E8E UNIX \u7684\u5546\u4E1A\u684C\u9762\u73AF\u5883) \u7684\u7528\u6237\u754C\u9762\uFF1B\u800C\u5728 Linux \u4E0A\u5E7F\u6CDB\u5E94\u7528\u7684\u6709 Gnome\u3001KDE \u7B49\u3002</p><h2 id="\u534F\u8BAE" tabindex="-1"><a class="header-anchor" href="#\u534F\u8BAE" aria-hidden="true">#</a> \u534F\u8BAE</h2><p>\u65E9\u5728 20 \u4E16\u7EAA 70 \u5E74\u4EE3\uFF0CUNIX \u7CFB\u7EDF\u662F\u5F00\u6E90\u800C\u4E14\u514D\u8D39\u7684\uFF0C\u4F46\u662F\u5728 1979 \u5E74\u65F6\uFF0CAT&amp;T \u516C\u53F8\u5BA3\u5E03\u4E86\u5BF9 UNIX \u7CFB\u7EDF\u7684\u5546\u4E1A\u5316\u8BA1\u5212\uFF0C\u968F\u4E4B\u5F00\u6E90\u8F6F\u4EF6\u4E1A\u8F6C\u53D8\u6210\u4E86\u7248\u6743\u5F0F\u8F6F\u4EF6\u4EA7\u4E1A\uFF0C\u6E90\u4EE3\u7801\u88AB\u5F53\u4F5C\u5546\u4E1A\u673A\u5BC6\uFF0C\u6210\u4E3A\u4E13\u5229\u4EA7\u54C1\uFF0C\u4EBA\u4EEC\u518D\u4E5F\u4E0D\u80FD\u81EA\u7531\u5730\u4EAB\u53D7\u79D1\u6280\u6210\u679C\u3002</p><p>\u4E8E\u662F\u5728 1984 \u5E74\uFF0CRichard Stallman \u9762\u5BF9\u4E8E\u5982\u6B64\u5C01\u95ED\u7684\u8F6F\u4EF6\u521B\u4F5C\u73AF\u5883\uFF0C\u53D1\u8D77\u4E86 GNU \u6E90\u4EE3\u7801\u5F00\u653E\u8BA1\u5212\u5E76\u5236\u5B9A\u4E86\u8457\u540D\u7684 GPL \u8BB8\u53EF\u534F\u8BAE\u3002</p><p>1987 \u5E74\u65F6\uFF0CGNU \u8BA1\u5212\u83B7\u5F97\u4E86\u4E00\u9879\u91CD\u5927\u7A81\u7834\uFF0C\u5373\u53D1\u5E03\u4E86 gcc \u7F16\u8BD1\u5668\uFF0C\u8FD9\u4F7F\u5F97\u7A0B\u5E8F\u5458\u53EF\u4EE5\u57FA\u4E8E\u8BE5\u7F16\u8BD1\u5668\u7F16\u5199\u51FA\u5C5E\u4E8E\u81EA\u5DF1\u7684\u5F00\u6E90\u8F6F\u4EF6\u3002\u968F\u4E4B\uFF0C\u5728 1991 \u5E74 10 \u6708\uFF0C\u82AC\u5170\u8D6B\u5C14\u8F9B\u57FA\u5927\u5B66\u7684\u5728\u6821\u751F Linus Torvalds \u7F16\u5199\u4E86\u4E00\u6B3E\u540D\u4E3A Linux \u7684\u64CD\u4F5C\u7CFB\u7EDF\uFF0C\u8BE5\u7CFB\u7EDF\u56E0\u5176\u8F83\u9AD8\u7684\u4EE3\u7801\u8D28\u91CF\u4E14\u57FA\u4E8E GNU GPL \u8BB8\u53EF\u534F\u8BAE\u7684\u5F00\u653E\u6E90\u4EE3\u7801\u7279\u6027\uFF0C\u8FC5\u901F\u5F97\u5230\u4E86 GNU \u8BA1\u5212\u548C\u4E00\u5927\u6279\u9ED1\u5BA2\u7A0B\u5E8F\u5458\u7684\u652F\u6301\uFF0C\u968F\u540E Linux \u7CFB\u7EDF\u4FBF\u8FDB\u5165\u4E86\u5982\u706B\u5982\u837C\u7684\u53D1\u5C55\u9636\u6BB5\u3002</p><p>1994 \u5E74 1 \u6708\uFF0CBob Young(\u7EA2\u5E3D\u521B\u59CB\u4EBA)\u5728 Linux \u7CFB\u7EDF\u5185\u6838\u7684\u57FA\u7840\u4E4B\u4E0A\uFF0C\u96C6\u6210\u4E86\u4F17\u591A\u7684\u6E90\u4EE3\u7801\u548C\u7A0B\u5E8F\u8F6F\u4EF6\uFF0C\u53D1\u5E03\u4E86\u7EA2\u5E3D\u7CFB\u7EDF\u5E76\u5F00\u59CB\u51FA\u552E\u6280\u672F\u670D\u52A1\uFF0C\u8FD9\u8FDB\u4E00\u6B65\u63A8\u52A8\u4E86 Linux \u7CFB\u7EDF\u7684\u666E\u53CA\u3002</p><p>1998 \u5E74\u4EE5\u540E\uFF0C\u968F\u7740 GNU \u6E90\u4EE3\u7801\u5F00\u653E\u8BA1\u5212\u548C Linux \u7CFB\u7EDF\u7684\u7EE7\u7EED\u706B\u70ED\uFF0C\u4EE5 IBM \u548C Intel \u4E3A\u9996\u7684\u591A\u5BB6 IT \u4F01\u4E1A\u5DE8\u5934\u5F00\u59CB\u5927\u529B\u63A8\u52A8\u5F00\u653E\u6E90\u4EE3\u7801\u8F6F\u4EF6\u7684\u53D1\u5C55\u3002</p><p>\u5230\u4E86 2017 \u5E74\u5E74\u5E95\uFF0CLinux \u5185\u6838\u5DF2\u7ECF\u53D1\u5C55\u5230\u4E86 4.13 \u7248\u672C\uFF0C\u5E76\u4E14 Linux \u7CFB\u7EDF\u7248\u672C\u4E5F\u6709\u6570\u767E\u4E2A\u4E4B\u591A\uFF0C\u4F46\u5B83\u4EEC\u4F9D\u7136\u90FD\u4F7F\u7528 Linus Torvalds \u5F00\u53D1\u3001\u7EF4\u62A4\u7684 Linux \u7CFB\u7EDF\u5185\u6838\u3002RedHat \u516C\u53F8\u4E5F\u6210\u4E3A\u4E86\u5F00\u6E90\u884C\u4E1A\u53CA Linux \u7CFB\u7EDF\u7684\u5E26\u5934\u516C\u53F8\u3002</p><p>\u521D\u6B65\u63A5\u89E6 Linux \u7684\u8BFB\u8005\uFF0C\u6216\u8005\u6709\u8FD9\u6837\u4E00\u4E2A\u7591\u95EE\uFF0CWindows \u7CFB\u7EDF\u4E5F\u5F88\u597D\u7528\uFF0C\u4E5F\u80FD\u6EE1\u8DB3\u65E5\u5E38\u5DE5\u4F5C\u9700\u6C42\uFF0C\u4E3A\u4EC0\u4E48\u8981\u5B66\u4E60 Linux \u7CFB\u7EDF\u5462?</p><p>\u6709\u4E9B\u521D\u5B66\u8005\u4F1A\u5C06\u201CLinxu \u7CFB\u7EDF\u662F\u5F00\u6E90\u7684\u201D\u4F5C\u4E3A\u8FD9\u4E2A\u95EE\u9898\u7684\u7B54\u6848\uFF0C\u5176\u5B9E\u4E0D\u7136\u3002\u5F00\u6E90\u7684\u64CD\u4F5C\u7CFB\u7EDF\u5C11\u8BF4\u6709 100 \u4E2A\uFF0C\u5F00\u6E90\u7684\u8F6F\u4EF6\u81F3\u5C11\u4E5F\u6709\u5341\u4E07\u4E2A\uFF0C\u4E3A\u4EC0\u4E48\u4E0D\u53BB\u9010\u4E2A\u5B66\u4E60? Linux \u7684\u5F00\u6E90\u7279\u6027\u53EA\u662F\u4E00\u90E8\u5206\u4F18\u52BF\uFF0C\u5E76\u4E0D\u662F\u5B66\u4E60 Linux \u7684\u4E3B\u8981\u539F\u56E0\u3002</p><p>\u5BF9\u4E8E\u7528\u6237\u6765\u8BB2\uFF0C\u5F00\u6E90\u7CBE\u795E\u4EC5\u5177\u5907\u9526\u4E0A\u6DFB\u82B1\u7684\u6548\u679C\uFF0C\u771F\u6B63\u7684\u539F\u56E0\u5728\u4E8E\uFF0CLinux \u7CFB\u7EDF\u662F\u4E00\u6B3E\u4F18\u79C0\u7684\u8F6F\u4EF6\u4EA7\u54C1\uFF0C\u5177\u6709\u7C7B\u4F3C UNIX \u7684\u7A0B\u5E8F\u754C\u9762\uFF0C\u800C\u4E14\u7EE7\u627F\u4E86 UNIX \u7684\u7A33\u5B9A\u6027\uFF0C\u80FD\u591F\u8F83\u597D\u5730\u6EE1\u8DB3\u5DE5\u4F5C\u9700\u6C42\u3002</p>',53),x=[r];function l(s,t){return n(),p("div",null,x)}var I=i(a,[["render",l],["__file","history.html.vue"]]);export{I as default};
